import { Component, ElementRef, OnInit, Renderer2, ViewChild } from '@angular/core';
import { Prospecto } from '../../Classes/Prospecto';

@Component({
  selector: 'app-home',
  templateUrl: './captura.component.html',
})
export class CapturaComponent implements OnInit {
  prospectoModel = new Prospecto("", "", "", "", 0, "", 0, "", "", [], "");
  exampleModel = new Prospecto("Lop", "Martin", "", "LOPS", 1000, "sojq", 80000, "6446644664", "1234567890123", [], "");
  counter = 0;

  constructor(private renderer: Renderer2) { }
  @ViewChild('documentos')
    d1!: ElementRef;

  ngOnInit() {
  }

  agregarDoc() {
    this.prospectoModel.documentos.push({ nombreDocumento: "", documento: null })
  }

  onSubmit() {
    this.exampleModel = this.prospectoModel;
    let { nombre, apellidoPaterno, apellidoMaterno, calle, numero, colonia, codigoPostal, telefono, rfc, documentos } = { ...this.prospectoModel };
    if (nombre && apellidoPaterno && calle && numero && colonia && codigoPostal && telefono.length == 10 && rfc.length == 13 && documentos[0].nombreDocumento && documentos[0].documento) {
      alert("Form Submitted!");
      console.log(this.prospectoModel);
    } else {
      alert("Faltan cositas")
    }
  }
}
